('2161','2','8294','Wohnung Rose',Null,'Ferienwohnung in 1. Meereslinie, Torrenova','30754','In 1. Meereslinie mit fantastischen Meerblick und Meerzugang, liegt diese Wohnung. Sie hat ca. 70m² Wohnfläche die sich aufteilen in Wohn-Esszimmer mit offener Küche, 2 Schlafzimmer und 2 Badezimmer sowie einer ca. 20m² großen Terrasse. Zur Wohnung gehören noch ein PKW Stellplatz und 2 Abstellräume. An kühleren Tagen sorgt eine Gaszentralheizung für die richtige Temperatur. Im Sommer kann man sich im Gemeinschaftspool oder im Meer abkühlen. Die Wohnung wird möbliert verkauft.\r\n\r\n\r\n','30755','350000','106','2014-02-19 16:21:54','106','2014-02-19 16:22:58',Null,'2080','106','986',1,'1','0',Null,Null,Null,'30756',Null,'0','0','0',Null,'2015-06-25 15:04:40',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'30757',Null,'30758',Null,'30759',Null,'30760','Joachim und Heidi 661 019516 o 971693056','30761','0',0,'0');
